import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import './Rolled.css'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

const Rolled = ({text, rolling}) => {
  return (
    <Container>
      <Row className="m-1 tabHeader">
        <Col className="p-1">
          {rolling ?
            
            <div className="p-1 rounded rolledWindow rollingIcon rollText"><FontAwesomeIcon icon="skull" /></div> :
            <div className="p-1 rounded rollText">{text}</div>
          }
        </Col>
      </Row>
    </Container>
  );
}

export default Rolled;
